import React, { Component } from 'react'
import Info from './Info/Info'
import  './Body.css'


class Body extends Component{
    state={
        covidvalue:{
            "tested_positive":36456,
        "tested_negative":621654,
        "tested_total":658110,
        "in_isolation":16019,
        "quarantined":8939,
        "tested_rdt":312402,
        "pending_result":0,
        "recovered":20242,
        "deaths":195,
      
    }
    }
   
    render(){

       let inforender=""


        let printObj = (obj) =>{ 

            for(var prop in obj) { 
              inforender+=<Info type="info" number={obj[prop]} title={prop}></Info>

            } 

        } 

        printObj(this.state.covidvalue)


       return(
        <div className="body">
            <div className="row">

                {inforender}

            </div>
        </div>
        )
    }
}

export default Body
